const AddNewPlaylistModal = ({ isModalOpen, switchModal }) => {
  const crossClickHandler = () => {
    switchModal((prevState) => !prevState);
  };
  return (
    <div className="modal shadow">
      <button
        onclick={crossClickHandler}
        className="card-cross btn-close is-medium"
      >
        <i className="fas fa-times" />
      </button>
      <i className="modal-icon is-green fas fa-check-circle" />
      <div className="textbox">
        <div className="title text-center">Order Placed!</div>
        <div className="text text-center">
          Lorem ipsum dolor sit amet consectetur adipisicing elit. Sunt iste
          corporis, maiores dolorum alias non?
        </div>
      </div>
      <div className="btn-horizontal">
        <button className="btn-grey btn-small">close</button>
      </div>
    </div>
  );
};

export { AddNewPlaylistModal };
